import React from 'react';
import phone from '../../assets/images/phone.png'

const Download = () => {
    return (
        <div className='p-[100px]rounded-[30px] bg-white shadow-custom'>

        <div className='flex justify-between p-[100px]'>
            <img src={phone} alt="" />
        </div>
        </div>
    );
}

export default Download;
